import React from 'react';
import VideoItem from './VideoItem';

const VideoList = ({ videos, onDelete, voteUp, voteDown }) => {
  return (
    <div className="video-list">
      {videos.map((video) => (
        <VideoItem
          key={video.id}
          video={video}
          voteUp={voteUp}
          voteDown={voteDown}
          onDelete={onDelete} />
      ))}
    </div>
  );
};

export default VideoList;










